import WhiteKey from './WhiteKey'
import BlackKey from './BlackKey'
import '../styles/Piano.css'

function Piano() {
  return (
    <div className='piano'>

      <WhiteKey note='A0'/>
      <BlackKey note='A#0'/>
      <WhiteKey note='B0'/>





    </div>
  )
}

export default Piano
